import React, { useState } from 'react';
import axios from 'axios';
import './DoctorRegistrationPage.css'; // Add your CSS for styling

const DoctorRegistrationPage = () => {
    const [formData, setFormData] = useState({
        name: '',
        gender: '',
        qualification: '',
        college: '',
        address: '',
        contactNo: '',
        email: '',
        expertise: '',
        documentType: '',
        cv: null
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleFileChange = (e) => {
        setFormData({
            ...formData,
            cv: e.target.files[0]
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        const form = new FormData();
        for (const key in formData) {
            form.append(key, formData[key]);
        }

        try {
            const response = await axios.post('http://localhost:5000/api/doctors', form, {
                headers: {
                    'Content-Type': 'multipart/form-data'
                }
            });
            alert('Doctor registered successfully!');
            setFormData({
                name: '',
                gender: '',
                qualification: '',
                college: '',
                address: '',
                contactNo: '',
                email: '',
                expertise: '',
                documentType: '',
                cv: null
            });
        } catch (error) {
            console.error('Error registering doctor:', error);
            alert('Failed to register doctor.');
        }
    };

    return (
        <div className="doctor-registration-page">
            <h1>Doctor Registration</h1>
            <form onSubmit={handleSubmit}>
                <label htmlFor="name">Name:</label>
                <input
                    type="text"
                    id="name"
                    name="name"
                    value={formData.name}
                    onChange={handleChange}
                    required
                />

                <label htmlFor="gender">Gender:</label>
                <select
                    id="gender"
                    name="gender"
                    value={formData.gender}
                    onChange={handleChange}
                    required
                >
                    <option value="">Select Gender</option>
                    <option value="Male">Male</option>
                    <option value="Female">Female</option>
                    <option value="Other">Other</option>
                </select>

                <label htmlFor="qualification">Qualification:</label>
                <select
                    id="qualification"
                    name="qualification"
                    value={formData.qualification}
                    onChange={handleChange}
                    required
                >
                    <option value="">Select Qualification</option>
                    <option value="BPT">BPT</option>
                    <option value="MPT">MPT</option>
                    <option value="DIPLOMA">DIPLOMA</option>
                </select>

                <label htmlFor="college">College:</label>
                <input
                    type="text"
                    id="college"
                    name="college"
                    value={formData.college}
                    onChange={handleChange}
                    required
                />

                <label htmlFor="address">Address:</label>
                <textarea
                    id="address"
                    name="address"
                    value={formData.address}
                    onChange={handleChange}
                    required
                ></textarea>

                <label htmlFor="contactNo">Contact No:</label>
                <input
                    type="text"
                    id="contactNo"
                    name="contactNo"
                    value={formData.contactNo}
                    onChange={handleChange}
                    required
                />

                <label htmlFor="email">Email:</label>
                <input
                    type="email"
                    id="email"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                />

                <label htmlFor="expertise">Expertise:</label>
                <input
                    type="text"
                    id="expertise"
                    name="expertise"
                    value={formData.expertise}
                    onChange={handleChange}
                    required
                />

                <label htmlFor="documentType">Document Required:</label>
                <select
                    id="documentType"
                    name="documentType"
                    value={formData.documentType}
                    onChange={handleChange}
                    required
                >
                    <option value="">Select Document</option>
                    <option value="result">Result</option>
                    <option value="experience">Experience</option>
                </select>

                <label htmlFor="cv">Upload CV:</label>
                <input
                    type="file"
                    id="cv"
                    name="cv"
                    onChange={handleFileChange}
                    required
                />

                <button type="submit">Register Doctor</button>
            </form>
        </div>
    );
};

export default DoctorRegistrationPage;
